INSERT INTO `t_doc_chapter` (`id`, `doc_id`, `parent_id`, `path`, `title`, `content`, `modify_time`, `user`, `seq`) VALUES
	(1, 1, NULL, '-1-', '构建', '', '2021-08-09 09:35:02', NULL, 1),
	(2, 1, 1, '-1-2-', '经典编辑器', '<h2>你从旅行中学到的三件事</h2><p>就像地球上所有伟大的事物一样，旅行以身作则教给我们。以下是我多年来旅行中学到的一些最宝贵的教训。</p><figure class="image image-style-align-right"><img src="data:image/jpeg;base64,"></figure><h3>欣赏多样性</h3><p>适应完全不同的文化可能具有挑战性。虽然在线或从书籍中了解文化也很好，但没有什么比亲身体验文化多样性更接近的了。当您变得更具文化流动性时，您将学会欣赏每一个差异。</p><blockquote><p>真正的发现之旅不在于寻找新的风景，而在于拥有新的眼光。</p><p><strong>马塞尔·普鲁斯特</strong></p></blockquote><h3>即兴创作</h3><p>生活不允许我们完美地执行每一个计划。旅行时尤其如此。你用一个大清单将它计划到每一分钟；但是当涉及到执行它时，总会出现一些问题，而你的即兴技能就剩下了。你学会了适应。这是我的旅行清单现在的样子：</p><ul><li>买票</li><li>开始你的冒险</li></ul><figure class="image image-style-align-right"><img src="data:image/jpeg;base64,"></figure><h3>置信度</h3><p>去一个新的地方可能会非常可怕。虽然变化和不确定性让我们感到害怕，但旅行告诉我们在事情发生之前害怕是多么荒谬。当你面对恐惧并看到没有什么可害怕的那一刻，就是你发现幸福的那一刻。</p>', '2021-08-09 09:35:28', NULL, 1),
	(3, 1, 1, '-1-3-', '文件编辑器', '<p>本示例中的编辑器是一个功能丰富的构建，专注于类似于原生文字处理器的富文本编辑体验。它最适合创建通常稍后打印或导出为 PDF 文件的文档。</p><h2 style="text-align:center;">The Flavorful Tuscany Meetup</h2><h3 style="text-align:center;">Welcome letter</h3><p>Dear Guest,</p><p>We are delighted to welcome you to the annual <i>Flavorful Tuscany Meetup</i> and hope you will enjoy the programme as well as your stay at the Bilancino Hotel.</p><figure class="image"><img src="data:image/jpeg;base64,"></figure><p>Please find below the full schedule of the event.</p><figure class="table"><table><thead><tr><th colspan="2">Saturday, July 14</th></tr></thead><tbody><tr><td>9:30 AM - 11:30 AM</td><td><p><strong>Americano vs. Brewed</strong> - “know your coffee” with:&nbsp;</p><ul><li>Giulia Bianchi</li><li>Stefano Garau</li><li>Giuseppe Russo</li></ul></td></tr><tr><td>1:00 PM - 3:00 PM</td><td><p><strong>Pappardelle al pomodoro</strong> - live cooking</p><p>Incorporate the freshest ingredients&nbsp;<br>with Rita Fresco</p></td></tr><tr><td>5:00 PM - 8:00 PM</td><td><strong>Tuscan vineyards at a glance</strong> - wine-tasting&nbsp;<br>with Frederico Riscoli</td></tr></tbody></table></figure><blockquote><p>The annual Flavorful Tuscany meetups are always a culinary discovery. You get the best of Tuscan flavors during an intense one-day stay at one of the top hotels of the region. All the sessions are lead by top chefs passionate about their profession. I would certainly recommend to save the date in your calendar for this one!</p><p>Angelina Calvino, food journalist</p></blockquote><p>Please arrive at the Bilancino Hotel reception desk <span style="background-color:#e6e64c;">at least half an hour earlier</span> to make sure that the registration process goes as smoothly as possible.</p><p>We look forward to welcoming you to the event.</p><figure class="image image_resized" style="width:20.9%;"><img src="data:image/png;base64,"></figure><p><strong>Victoria Valc</strong></p><p><strong>Event Manager</strong></p><p><strong>Bilancino Hotel</strong></p>', '2021-08-09 09:35:48', NULL, 2),
	(4, 1, NULL, '-4-', '指南', '', '2021-08-09 09:35:57', NULL, 2),
	(5, 1, 4, '-4-5-', '概述', '<p style="margin-left:0px;">CKEditor 5 是一个项目，允许您快速轻松地初始化它在您的应用程序中提供的多种类型的编辑器之一。同时，它是一个用于创建定制的富文本编辑解决方案的框架。CKEditor 5 Builds满足了前一个要求。后者——感谢 CKEditor 5 框架。</p><p style="margin-left:0px;">本指南解释了框架是如何构建的以及如何开始使用它。</p><p style="margin-left:0px;">&nbsp;</p><h2 style="margin-left:0px;"><br>什么时候使用框架？</h2><p style="margin-left:0px;">CKEditor 5 Builds 可以自定义，但某些类型的自定义需要使用框架。</p><ul><li><strong>编写自己的功能。</strong>功能是使用框架实现的。</li><li><strong>自定义现有功能。</strong>可以使用框架功能来更改现有功能的行为或外观。</li><li><strong>创建新类型的编辑器。</strong>您可以使用该框架创建新的编辑器类型。</li></ul><p style="margin-left:0px;">总结一下：一旦现有构建不满足您的要求或无法自定义到您想要的程度，您就需要开始使用该框架。</p><p style="margin-left:0px;">&nbsp;</p><h2 style="margin-left:0px;">设计</h2><p style="margin-left:0px;">该框架旨在成为一个高度灵活和通用的平台，用于创建自定义富文本编辑解决方案。同时，它满足了使实现功能尽可能简单的几个目标。</p><ul><li><strong>基于插件的架构。</strong>一切都是插件——甚至是诸如支持输入或&lt;p&gt;元素之类的关键功能。您可以删除插件或用您自己的实现替换它们以实现完全自定义的结果。</li><li><strong>无模式核心。</strong>核心做出最少的假设，并且可以通过模式进行控制。这将所有决定留给插件，因此留给您。</li><li><strong>协作就绪。</strong>或者更确切地说，实时协作已<strong>准备好供您使用</strong>！编辑器为树结构模型以及创建无缝协作 UX 所需的许多其他机制实施操作转换。此外，我们提供云基础架构和插件，可在您的应用程序中实现实时协作编辑！检查协作演示。</li><li><strong>自定义数据模型。</strong>编辑引擎实现了树结构的自定义数据模型，旨在满足多种需求，例如启用实时协作和复杂的编辑功能（如表格或嵌套块）。</li><li><strong>虚拟 DOM。</strong>编辑引擎具有自定义的、面向编辑的虚拟 DOM 实现，旨在隐藏您视线中的浏览器怪癖。<strong>不要再contentEditable做噩梦了！</strong></li><li><strong>细粒度的、可重复使用的功能。</strong>功能以细粒度的方式实现。这允许重用和重新组合它们，从而使自定义和扩展编辑器成为可能。例如，图像功能目前由 10 多个插件组成。</li><li><strong>可扩展性。</strong>整个编辑器架构旨在实现最大的灵活性。该代码基于事件且高度解耦，允许您插入或替换选定的部分。功能不直接相互依赖并以标准化方式进行通信。</li><li><strong>一个漂亮的用户界面。</strong>文本编辑不仅仅是打字——您的用户将需要一个 UI 来创建链接或管理图像。我们认为需要仔细设计合适的用户体验，我们没有跳过这一部分。对提议的用户界面有第二个想法吗？完全没有问题！由于其解耦 UI，您始终可以为 CKEditor 5 创建自定义界面。</li><li><strong>质量。</strong>所有官方包都有广泛的测试套件（100% 的代码覆盖率只是一个步骤）。所有代码都有大量的API 文档。</li><li><strong>最低配置。</strong>为了避免膨胀，功能具有最少的配置。通过使用自定义功能重新组合它们，可以对它们的行为进行更深层次的更改。</li><li><strong>8 年以上的支持。</strong>它不是明年将消失的另一个框架，也不是在现实生活中失败的大肆宣传的概念验证。我们在创建富文本编辑器方面拥有超过 15 年的经验，并在设计和构建您选择的下一个面向未来的富文本编辑器方面投入了 4 年多的时间。</li></ul>', '2021-08-09 09:36:14', NULL, 1),
	(6, 1, 4, '-4-6-', '快速开始', '<p><span style="background-color:rgb(255,255,255);color:rgb(26,26,26);">本指南将向您展示如何从源代码初始化 CKEditor 5 富文本编辑器。</span></p><h2 style="margin-left:0px;"><br>如何安装框架？</h2><p style="margin-left:0px;">CKEditor 5 框架由几个npm 包组成。要安装它，您需要：</p><ul><li>Node.js 12.0.0+</li><li>npm 5.7.1+（<strong>注意：</strong>已知一些 npm 5+ 版本会导致问题，尤其是去重包；有疑问时升级 npm）</li></ul><p style="margin-left:0px;">除了 Node.js 和 npm，您还需要带有一些附加包的webpack@4才能使用该框架。需要它们来捆绑源代码。在CKEditor 5 Builds Advanced 设置指南中阅读有关构建 CKEditor 5 的更多信息。</p><h2 style="margin-left:0px;"><br>开始吧！</h2><p style="margin-left:0px;">本指南假设您熟悉 npm 并且您的项目已经使用 npm。如果没有，请参阅npm 文档或调用npm init一个空目录并保持交叉。</p>', '2021-08-09 09:36:32', NULL, 2),
	(7, 1, 4, '-4-7-', '创建一个简单的插件', '<p style="margin-left:0px;">本指南将向您展示如何为 CKEditor 5 创建一个简单的富文本编辑器插件。</p><p style="margin-left:0px;">在开始工作之前，您应该先查看快速入门指南以设置框架和构建工具。</p><p style="margin-left:0px;">CKEditor 插件需要实现PluginInterface. 最简单的方法是从基Plugin类继承。但是，您也可以编写简单的构造函数。本指南使用前一种方法。</p><p style="margin-left:0px;">您将编写的插件将使用图像功能的一部分，并将为其添加一个简单的用户界面——一个“插入图像”按钮，单击时将打开一个提示窗口，询问图像 URL。提交 URL 将导致将图像插入到内容中并选择它。</p><p style="margin-left:0px;">我们建议使用官方的CKEditor 5 检查器进行开发和调试。它将为您提供大量有关编辑器状态的有用信息，例如内部数据结构、选择、命令等等。</p><p style="margin-left:0px;">为简单起见，本指南不描述如何本地化创建的插件。要查看如何本地化插件，请参阅本地化指南。</p>', '2021-08-09 09:36:47', NULL, 3),
	(8, 1, 7, '-4-7-8-', '步骤 1. 安装依赖项', '<p style="margin-left:0px;">从安装必要的依赖项开始：</p><ul><li>@ckeditor/ckeditor5-image包含图像功能的包（插件将依赖）。</li><li>@ckeditor/ckeditor5-core包含Plugin和Command类的包。</li><li>@ckeditor/ckeditor5-ui包含 UI 库和框架的包。</li></ul><p style="margin-left:0px;">大多数情况下，您还需要安装@ckeditor/ckeditor5-engine软件包（它包含编辑引擎）。本指南中省略了它，因为对于像这样的简单插件来说是不必要的。</p><p style="margin-left:0px;">现在，打开app.js文件并开始在那里添加代码。通常，在实现更复杂的功能时，您需要将代码拆分为多个文件（模块）。但是，为了使本指南更简单，整个代码将保留在app.js.</p><p style="margin-left:0px;">首先要做的是加载图像功能的核心：</p><p style="margin-left:0px;">保存文件并运行 webpack。刷新浏览器中的页面（<strong>记住缓存</strong>）并且……您不应该看到任何更改。这是对的！图像功能的核心不附带任何 UI，也没有在初始 HTML 中添加任何图像。现在改变这个：</p><p style="margin-left:0px;">使用该-w选项运行 webpack将在监视模式下启动它。这意味着 webpack 将在您每次保存文件时监视您的文件的更改并重建应用程序。</p>', '2021-08-09 09:37:03', NULL, 1),
	(9, 1, 7, '-4-7-9-', '步骤 2. 创建插件', '<p style="margin-left:0px;">据说您的InsertImage插件依赖于插件在此处表示的图像功能Image。您可以将Image插件添加为插件的依赖项InsertImage。这将使编辑器在初始化Image之前自动初始化InsertImage，因此您可以Image从config.plugins.</p><p style="margin-left:0px;">但是，这意味着您的插件将与Image插件耦合。这是不必要的——他们不需要彼此了解。虽然在这个简单的例子中它没有改变任何东西，但保持插件尽可能解耦是一个很好的做法。</p>', '2021-08-09 09:37:16', NULL, 2),
	(10, 1, 9, '-4-7-9-10-', '柴油机图片-test', '<p>V12柴油机</p><figure class="image"><img src="data:image/jpeg;base64,"></figure>', '2021-08-09 09:52:27', NULL, 1);
